package com.mastertheboss.undertow.cache.binarySearch;


public class Scores{
    short s1;
    short s2;
    short s3;
    public Scores(short s1, short s2, short s3){
        this.s1 = s1;
        this.s2 = s2;
        this.s3 = s3;
    }
    public short getS1(){return s1;}
    public short getS2(){return s2;}
    public short getS3(){return s3;}
}
